import "./App.css";
import { useEffect, useState } from "react";

// function SearchDisplay(props) {
//   var list1 = props.map((data) => {
//     return <li>{data.external_urls}</li>;
//   });
//   return <ul>{list1}</ul>;
// }
function App() {
  const [data, setData] = useState(0);
  const [albums, setAlbums] = useState(undefined);
  const [artists, setArtists] = useState(undefined);
  const [tracks, setTracks] = useState(undefined);
  const token =
    "BQB3lOxrKzFM74WfohEo1rfLo7TKz2x0htUjfzKdW1xzHeaX5Xz3z-biB_1QMxRh7NhXDf69tTiyN0DtQ6nv3si17u_0V-zlGiIoZMpZT0O3U0lguaqpz0-IEOtxTp3F6QVjp_26Q3QcnJaRcOdSTjWZovdPOzbuboI";
  const search = "kendrick";
  async function fetchData() {
    const response = await fetch(
      `https://api.spotify.com/v1/search?q=${search}&type=album,track,artist`,
      {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      }
    );
    const info = await response.json();
    return await info;
  }
  useEffect(() => {
    fetchData().then((info) => {
      setData(info);
      setAlbums(info.albums.items);
      setArtists(info.artists.items);
      setTracks(info.tracks.items);
    });
  }, []);
  console.log(albums);
  let items = "hey";
  if (albums !== undefined) {
    console.log(albums);
    items = albums.map((album, index) => <p>{album.name}</p>);
  }
  return (
    <div className="App">
      <div>{items}</div>
    </div>
  );
}

export default App;
